package DiamonShop.Entity;

public class Offices {
	private int id;
	private String tenchi_nhanh;
	private String dia_chi;
	private String gio_mo;
	private String gio_dong;
	public Offices() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getTenchi_nhanh() {
		return tenchi_nhanh;
	}
	public void setTenchi_nhanh(String tenchi_nhanh) {
		this.tenchi_nhanh = tenchi_nhanh;
	}
	public String getDia_chi() {
		return dia_chi;
	}
	public void setDia_chi(String dia_chi) {
		this.dia_chi = dia_chi;
	}
	public String getGio_mo() {
		return gio_mo;
	}
	public void setGio_mo(String gio_mo) {
		this.gio_mo = gio_mo;
	}
	public String getGio_dong() {
		return gio_dong;
	}
	public void setGio_dong(String gio_dong) {
		this.gio_dong = gio_dong;
	}
	
}
